import React, {Component} from 'react';
import Button from "react-bootstrap/Button";


class Home extends Component {
    render() {
        return (
            <div className="text-center text-light main-body shadow">
                <div className="display-3 mt-3">React</div>
                <div className="display-4">Study Page</div>
                <div className="lead mt-3">Here you can find examples of react snippets and learning resources</div>
            </div>
        )
    }
}

export default Home;
